import '../../../../App.css';
import HeroSection from '../../../shared/HeroSection/HeroSection';

export default function Home () {
    
    useEffect(() => {
        document.title = "OI Exam System";
    }, [])

    return (
        <>
            <HeroSection/>
        </>
    )
};
